import React from 'react';
import ReactDOM from 'react-dom';

import Cards from "./Cards";
import './index.css';
import Sdata from './Sdata';

const netseries = 'Netflix';

function Net(){
  if (netseries === 'Netflix'){
    return (
      <Cards 
      key = {val.id}
      crdimg = {val.simgsrc}
      title= {val.stitle}
      category= {val.scategory} 
      link= {val.slink} 
    />
    )

  }
}


function App(){
    return (
        <React.Fragment>        
        <h1 className='heading_style'>The Top 5 Netflix Weberies</h1>

      </React.Fragment>
    )
}

export default App;
